    const [perfil, setPerfil] = useState([])
    useEffect(() => {
        (async () => {
            const id = localStorage.getItem('id')
            try {
                const response = await axios.post('http://localhost:3333/perfil', {
                "id": id
                })
                console.log(response.data)
                perfil.push(response.data)
                console.log(perfil)
            }catch(err) {
                console.log('error')
            }
           
            
